(79, 'widget_text', 'a:11:{i:2;a:4:{s:5:"title";s:0:"";s:4:"text";s:321:"<div class="iconImg"><img src="http://localhost/cultrahub/wp-content/uploads/2018/01/icon_learn.png" alt="" /></div>\r\n<div class="iconText">\r\n<h3 class="subheading2">Learn Cultures</h3>\r\nUsers can explore different cultures and learn from the information, articles, books, and store clips provided by producers.\r\n\r\n</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:3;a:4:{s:5:"title";s:0:"";s:4:"text";s:327:"<div class="iconImg"><img src="http://localhost/cultrahub/wp-content/uploads/2018/01/icon_sell.png" alt="" /></div>\r\n<div class="iconText">\r\n<h3 class="subheading2">Sell On Our Platform</h3>\r\nPlug and play infrastructure where consumers can become producers by creating a shop and listing products under any category.\r\n\r\n</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:4;a:4:{s:5:"title";s:0:"";s:4:"text";s:314:"<div class="iconImg"><img src="http://localhost/cultrahub/wp-content/uploads/2018/01/icon_card.png" alt="" /></div>\r\n<div class="iconText">\r\n<h3 class="subheading2">Shop Among Cultures</h3>\r\nConsumers will be able to find the latest cultural trends and unique products that cannot be found anywhere else.\r\n\r\n</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:5;a:4:{s:5:"title";s:0:"";s:4:"text";s:160:"<div class="quote mt70">To make the world a better place by creating a digital platform that fosters knowledge, spreads culture, and celebrates diversity.</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:6;a:4:{s:5:"title";s:20:"Cultrahubâ€™s Genres";s:4:"text";s:121:"<div class="heading_tag">Browse the different categories for the latest in fashion, sport apparel, tech and more...</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:7;a:4:{s:5:"title";s:51:"Explore Different Cultures and Discover New Trends!";s:4:"text";s:0:"";s:6:"filter";b:1;s:6:"visual";b:1;}i:8;a:4:{s:5:"title";s:0:"";s:4:"text";s:306:"<div class="policy_img"><img src="http://localhost/cultrahub/wp-content/uploads/2018/01/icon_gift.png" alt="" /></div>\r\n<div class="policy_text">\r\n<h2 class="heading">It is time! Fall in love over your next purchase.</h2>\r\nLorem ipsum dolor sit amet, consecte tur adipiscing elit, sed do eiusmod.\r\n\r\n</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:9;a:4:{s:5:"title";s:0:"";s:4:"text";s:297:"<div class="policy_img"><img src="http://localhost/cultrahub/wp-content/uploads/2018/01/icon_shop.png" alt="" /></div>\r\n<div class="policy_text">\r\n<h2 class="heading">Come a discover your next favorite shop.</h2>\r\nLorem ipsum dolor sit amet, consecte tur adipiscing elit, sed do eiusmod.\r\n\r\n</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:10;a:4:{s:5:"title";s:0:"";s:4:"text";s:318:"<div class="policy_img"><img src="http://localhost/cultrahub/wp-content/uploads/2018/01/icon_security.png" alt="" /></div>\r\n<div class="policy_text">\r\n<h2 class="heading">There is no other place more safely and securely than us.</h2>\r\nLorem ipsum dolor sit amet, consecte tur adipiscing elit, sed do eiusmod.\r\n\r\n</div>";s:6:"filter";b:1;s:6:"visual";b:1;}i:11;a:4:{s:5:"title";s:0:"";s:4:"text";s:346:"<ul class="borderbar_list">\r\n 	<li>Address: P.O. Box 44792, Indianapolis, IN 46244. United States.</li>\r\n 	<li>Phone: <span class="lr">+1 317 995-0006</span></li>\r\n</ul>\r\n<ul class="borderbar_list">\r\n 	<li>Fax: <span class="lr">+1 317 995-0006</span></li>\r\n 	<li>Email: <a href="mailto:contact@cultrahub.com">contact@cultrahub.com</a></li>\r\n</ul>";s:6:"filter";b:1;s:6:"visual";b:1;}s:12:"_multiwidget";i:1;}', 'yes'),
