(554, 1, '2018-03-31 16:15:08', '2018-03-31 16:15:08', '<h2 class="heading">The Easiest Way to Sell Your Products Online</h2>\n							<div class="sliderImg2">\n								<div class="sliderImgBox scroll_effect" data-effect="fadeInRight" data-delay="300">\n									<img src="http://localhost/cultrahub/wp-content/uploads/2018/03/seller_pic.png" alt="">\n								</div>\n							</div>\n							<div class="sliderText2 scroll_effect" data-effect="fadeInLeft" data-delay="300">\n								<div class="">\n									<ul class="bullet">\n										<li>\n											<div><strong>The worldâ€™s first e-commerce platform for cultural content</strong></div>\n											<div>Conduct online marketing and sales activities within your cultural niche and target other cultures with your talents.</div>\n										</li>\n										<li>\n											<div><strong>Share your unique products to the world</strong></div>\n											<div>Actively buy and sell custom and trending items from around the globe.</div>\n										</li>\n										<li>\n											<div><strong>Target your audience by culture, heritage, location or interest</strong></div>\n											<div>No more guess work, filter your audience with our unique insights.</div>\n										</li>\n										<li>\n											<div><strong>Easy to create a shop and list products</strong></div>\n											<div>Target millions of customers in just a few simple clicks. Start selling today!</div>\n										</li>\n									</ul>\n								</div>\n								<a href="be_a_seller.html" class="btn mr35">Learn More</a>\n							</div>', 'Home', '', 'inherit', 'closed', 'closed', '', '8-autosave-v1', '', '', '2018-03-31 16:15:08', '2018-03-31 16:15:08', '', 8, 'http://localhost/cultrahub/2017/12/06/8-autosave-v1/', 0, 'revision', '', 0),
