(1351, 1, '2018-01-23 17:27:08', '2018-01-23 17:27:08', '<p>Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt, vel illum qui dolorem eum fugiat quo voluptas nulla pariatu magni dolores eos.</p>', 'Sed Do Eiusmod Tempor Incididunt Ut', '', 'publish', 'closed', 'closed', '', 'sed-do-eiusmod-tempor-incididunt-ut', '', '', '2018-01-23 17:27:08', '2018-01-23 17:27:08', '', 0, 'http://localhost/cultrahub/?post_type=ch_menucategories&#038;p=1351', 0, 'ch_menucategories', '', 0),
(1352, 1, '2018-01-23 17:28:46', '2018-01-23 17:28:46', '<p>Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem.</p>', 'Ut enim ad minim veniam, quis nostrud', '', 'publish', 'closed', 'closed', '', 'ut-enim-ad-minim-veniam-quis-nostrud', '', '', '2018-01-23 17:28:46', '2018-01-23 17:28:46', '', 0, 'http://localhost/cultrahub/?post_type=ch_menucategories&#038;p=1352', 0, 'ch_menucategories', '', 0),
(1353, 1, '2018-01-23 17:30:18', '2018-01-23 17:30:18', '<p>Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi. Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat.</p>', 'Velit Esse Cillum Dolore Eu Fugiat Nulla', '', 'publish', 'closed', 'closed', '', 'velit-esse-cillum-dolore-eu-fugiat-nulla', '', '', '2018-01-23 17:30:18', '2018-01-23 17:30:18', '', 0, 'http://localhost/cultrahub/?post_type=ch_menucategories&#038;p=1353', 0, 'ch_menucategories', '', 0),
(1354, 1, '2018-01-23 17:32:22', '2018-01-23 17:32:22', '<p>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum.</p>', 'Sed Ut Perspiciatis Undes Omnis Iste Natus.', '', 'publish', 'closed', 'closed', '', 'sed-ut-perspiciatis-undes-omnis-iste-natus', '', '', '2018-01-23 17:32:22', '2018-01-23 17:32:22', '', 0, 'http://localhost/cultrahub/?post_type=ch_menucategories&#038;p=1354', 0, 'ch_menucategories', '', 0),
