(1470, 1, '2018-01-27 16:06:56', '2018-01-27 16:06:56', '<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusan tium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicaboo luptas sit aspernatur aut odit aut fugit, sed quia.</p>', 'Lorem Ipsum Dolor Sit Amet, Consectetur', '', 'publish', 'closed', 'closed', '', 'lorem-ipsum-dolor-sit-amet-consectetur', '', '', '2018-01-27 16:09:06', '2018-01-27 16:09:06', '', 0, 'http://localhost/cultrahub/?post_type=menucategories&#038;p=1470', 0, 'menucategories', '', 0),
(1471, 1, '2018-01-27 16:12:07', '2018-01-27 16:12:07', '<p>Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt, vel illum qui dolorem eum fugiat quo voluptas nulla pariatu magni dolores eos.</p>', 'Sed Do Eiusmod Tempor Incididunt Ut', '', 'publish', 'closed', 'closed', '', 'sed-do-eiusmod-tempor-incididunt-ut', '', '', '2018-01-27 16:12:07', '2018-01-27 16:12:07', '', 0, 'http://localhost/cultrahub/?post_type=menucategories&#038;p=1471', 0, 'menucategories', '', 0),
(1472, 1, '2018-01-27 16:13:48', '2018-01-27 16:13:48', '<p>Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi. Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat.</p>', 'Velit Esse Cillum Dolore Eu Fugiat Nulla', '', 'publish', 'closed', 'closed', '', 'velit-esse-cillum-dolore-eu-fugiat-nulla', '', '', '2018-01-27 16:13:48', '2018-01-27 16:13:48', '', 0, 'http://localhost/cultrahub/?post_type=menucategories&#038;p=1472', 0, 'menucategories', '', 0),
(1473, 1, '2018-01-27 16:15:01', '2018-01-27 16:15:01', '<p>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum.</p>', 'Sed Ut Perspiciatis Undes Omnis Iste Natus.', '', 'publish', 'closed', 'closed', '', 'sed-ut-perspiciatis-undes-omnis-iste-natus', '', '', '2018-01-27 16:15:01', '2018-01-27 16:15:01', '', 0, 'http://localhost/cultrahub/?post_type=menucategories&#038;p=1473', 0, 'menucategories', '', 0),
