(1581, 1, '2018-01-28 13:17:48', '2018-01-28 13:17:48', '<p>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident. Similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est .</p>', 'Islamic', '', 'inherit', 'closed', 'closed', '', '1503-autosave-v1', '', '', '2018-01-28 13:17:48', '2018-01-28 13:17:48', '', 1503, 'http://localhost/cultrahub/1503-autosave-v1/', 0, 'revision', '', 0),
