(2904, 1, '2018-04-01 08:58:45', '2018-04-01 08:58:45', '<ul class="ul row"><li class="col50"><label>First Name</label>[text* First-Name placeholder "Write your first name"]</li><li class="col50"><label>Last Name</label>[text* Last-Name placeholder "Write your last name"]</li><li class="col100"><label>Email Address</label><br />[email* Email-Address placeholder "Write your email address"]</li><li class="col100"><label>Feedback</label><br />[textarea* Feedback placeholder "Your feedback about the site"]</li><li class="col100"><label>Mood</label><div class="mood_list">[radio Mood class:cultra_mood use_label_element default:0 "Love it!" "Awesome!" "Like it!" "Donâ€™t Like it!" "Boring!"]</div></li><li class="col100 align_center"><input type="submit" value="SUBMIT FEEDBACK" class="btnRed w80"><div class=""><small>You can also email us at <a href="mailto:info@cultrahub.com">info@cultrahub.com</a>.</small></div></li></ul>\n1\nShare Your Thoughts\n[First-Name] [Last-Name] <info@cultrahub.com>\ninfo@cultrahub.com\nFirst Name: [First-Name]\r\nLast Name: [Last-Name]\r\nEmail Address: [Email-Address]\r\nFeedback: [Feedback]\r\nMood: [Mood]\nReply-To: [Email-Address]\n\n\n\n\nCultrahub "[your-subject]"\nCultrahub <100websolution@gmail.com>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Cultrahub (http://localhost/cultrahub)\nReply-To: 100websolution@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Share Your Thoughts', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2018-04-01 12:13:07', '2018-04-01 12:13:07', '', 0, 'http://localhost/cultrahub/?post_type=wpcf7_contact_form&#038;p=2904', 0, 'wpcf7_contact_form', '', 0),
